def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if ratios[i] < 0.2:
            priorities[i] = np.power(np.sin(item) + np.cos(bins[i]), 2) + np.sqrt(item * bins[i])
        elif ratios[i] >= 0.2 and ratios[i] < 0.4:
            priorities[i] = np.tan(item) + np.tan(bins[i]) - np.log(item + bins[i] + 1)
        elif ratios[i] >= 0.4 and ratios[i] < 0.6:
            priorities[i] = np.log(np.abs(item - bins[i]) + 1) * np.sqrt(item) + np.power(bins[i], 2)
        elif ratios[i] >= 0.6 and ratios[i] < 0.8:
            priorities[i] = np.arctan(np.sqrt(item * bins[i])) + np.sqrt(item * bins[i] + 10)
        else:
            priorities[i] = np.cosh(np.exp(ratios[i])) * np.tanh(np.sqrt(ratios[i])) - np.log(ratios[i] + 1) + np.power(item, 3)

    for j in range(len(bins)):
        if priorities[j] < 15:
            priorities[j] *= 2
        elif priorities[j] >= 15 and priorities[j] < 25:
            priorities[j] *= 3
        elif priorities[j] >= 25 and priorities[j] < 35:
            priorities[j] /= 2
        else:
            priorities[j] = np.cbrt(priorities[j])

    for k in range(len(bins)):
        if priorities[k] % 2 == 0:
            priorities[k] += item
        else:
            priorities[k] -= bins[k] / 2

        if item > 10:
            priorities[k] *= 1.2
        else:
            priorities[k] = np.exp(priorities[k])

    final_priorities = np.where(priorities < 20, priorities * 1.5, priorities * 0.8)

    return final_priorities
